Rules.InvariantScript:
If(
    IsBlankOrError(
        LookUp(
            _tempDataAux,
            tela = Parent.Ancora
        )
    ),
    Collect(
        _tempDataAux,
        {
            data: Self.SelectedDate,
            tela: Parent.Ancora
        }
    ),
    Patch(
        _tempDataAux,
        LookUp(
            _tempDataAux,
            tela = Parent.Ancora
        ),
        {data: Self.SelectedDate}
    )
);

If(
    IsBlankOrError(
        LookUp(
            _tempDataAux,
            tela = Parent.Ancora
        )
    ),
    Collect(
        _tempDataAux,
        {
            data: If(
                IsMatch(
                    Self.Value,
                    "^\d{2}/\d{2}/\d{4}$"
                ) && !IsBlankOrError(DateValue((Self.Value))),
                DateValue(Self.Value),
                IsMatch(
                    Self.Value,
                    "^\d{8}$"
                ),
                DateValue(
                    Mid(
                        Self.Value,
                        1,
                        2
                    ) & "/" & Mid(
                        Self.Value,
                        3,
                        2
                    ) & "/" & Mid(
                        Self.Value,
                        5,
                        4
                    )
                ),
                Blank()
            ),
            tela: Parent.Ancora
        }
    ),
    Patch(
        _tempDataAux,
        LookUp(
            _tempDataAux,
            tela = Parent.Ancora
        ),
        {
            data: If(
                IsMatch(
                    Self.Value,
                    "^\d{2}/\d{2}/\d{4}$"
                ) && !IsBlankOrError(DateValue((Self.Value))),
                DateValue(Self.Value),
                IsMatch(
                    Self.Value,
                    "^\d{8}$"
                ),
                DateValue(
                    Mid(
                        Self.Value,
                        1,
                        2
                    ) & "/" & Mid(
                        Self.Value,
                        3,
                        2
                    ) & "/" & Mid(
                        Self.Value,
                        5,
                        4
                    )
                ),
                Blank()
            )
        }
    )
);
Reset(Self);
Reset(entradaDataEmCalendario)
